INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("お！\nあそこに困ってそうな人発見！", 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 2, 1, 0, "春咲 ひより", 0, 1001, 1.4, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("大切な人を\n守れるようになりたい…って", 0, 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 2, 1, 0, "草野 優衣", 0, 1002, 1.4, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("キミに必要な集中力と感性が", 0, 0, "フェンシングを始めてみては？", 1, 2, 1, 0, "士条 怜", 0, 1003, 1.4, 1, 0, "少しは磨かれると思いますよ。");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("今日はなにして遊ぶ？", 0, 0, "ねぇ、にいちゃん！", 1, 2, 1, 0, "穂高 みそぎ", 0, 1004, 1.5, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ねぇ…", 0, 0, "風宮あかりです", 1, 2, 1, 0, "風宮 あかり", 0, 1006, 1.4, 1, 0, "私といっしょに…\nいかない？");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("プリンたべたいのー", 0, 0, "出雲宮子なのー", 1, 2, 1, 0, "出雲 宮子", 0, 1007, 1.5, 1, 0, "食べ物の恨みは怖いのー");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, "ボクは虹村雪。", 1, 2, 1, 0, "虹村 雪", 0, 1008, 1.4, 1, 0, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, "フッ…聞いて後悔するがいい！", 1, 2, 1, 0, "柊杏奈", 0, 1009, 1.4, 1, 0, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 2, 1, 0, "姫宮 真歩", 0, 1010, 1.5, 1, 0, "ほんまおおきにやわ～♪");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, "衣之咲璃乃です！", 1, 2, 1, 0, "衣之咲 璃乃", 0, 1011, 1.4, 1, 0, "ここで会ったが\n100年目～！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ち、超能力って…\n何のことかな～？", 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 2, 1, 0, "柏崎 初音", 0, 1012, 1.4, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("一応カリスマ読モJKやってまっす！", 0, 0, "ちょす！\n美波鈴奈だよ～♪", 1, 2, 1, 0, "美波 鈴奈", 0, 1016, 1.4, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("東京は遊園地みたいなところさー", 0, 0, "はいたーい。\n喜屋武香織さー。", 1, 2, 1, 0, "喜屋武 香織", 0, 1017, 1.4, 1, 0, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("先生って呼ばれるのは\nくすぐったいから", 0, 0, "支倉伊緒です。", 1, 2, 1, 0, "支倉 伊緒", 0, 1018, 1.4, 1, 0, "イオちゃんって呼んでね。");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 2, 1, 0, "茜 ミミ", 0, 1020, 1.5, 1, 0, "ミミをおいてかないでぇ～");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あの……\nふぇ……", 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 2, 1, 0, "栗林 くるみ", 0, 1021, 1.5, 1, 0, "ふぇぇぇぇぇん……");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("こんな私に貴重な時間を\n割いていただき、", 0, 0, "風宮よりです。\nあああああ！", 1, 2, 1, 0, "風宮 より", 0, 1022, 1.4, 1, 0, "なんてありがとうございます！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("おにいちゃんどこいくの？\nえ？", 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 2, 1, 0, "北条 綾音", 0, 1023, 1.5, 1, 0, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 2, 1, 0, "天野 すずめ", 0, 1025, 1.4, 1, 0, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あなたは…運命の……\n伴侶……", 0, 0, "……クスクス…私は\n…倉石恵理子……", 1, 2, 1, 0, "倉石 恵理子", 0, 1027, 1.4, 1, 0, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 2, 1, 0, "佐々木 咲恋", 0, 1028, 1.4, 1, 0, "…そうでしょ？？");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ぇっと…\nキミ、私のこと知らないの?!", 0, 0, "桜井望だよ！\nよろしくねっ", 1, 2, 1, 0, "桜井 望", 0, 1029, 1.4, 1, 0, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, "デケデケデンっ！", 1, 2, 1, 0, "ニノン・ジュベール", 0, 1030, 1.4, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("でもって私の隣にいるのが……\nえ、見えない？", 0, 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 2, 1, 0, "上喜 しのぶ", 0, 1031, 1.4, 1, 0, "おかしいですね……");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("けんども\nそれには足りないモンが…", 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 2, 1, 0, "野戸まひる", 0, 1033, 1.5, 1, 0, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ちょっと緊張しちゃって…", 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 2, 1, 0, "綾瀬 ゆかり", 0, 1034, 1.4, 1, 0, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("知らない人とは話しちゃいけないので", 0, 0, "氷川鏡華…です", 1, 2, 1, 0, "氷川 鏡華", 0, 1036, 1.5, 1, 0, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("……あ、アラーム。", 0, 0, "柏崎…栞です。", 1, 2, 1, 0, "柏崎 栞", 0, 1038, 1.4, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私、一人も友達がいなくて……", 0, 0, "ふ、双葉碧です。", 1, 2, 1, 0, "双葉 碧", 0, 1040, 1.4, 1, 0, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 0, "三角千歌です。", 1, 2, 1, 0, "三角 千歌", 0, 1042, 1.4, 1, 0, "そう思っています。");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あぁ？\nお前のそいつの仲間か？", 0, 0, "安芸真琴だ。", 1, 2, 1, 0, "安芸 真琴", 0, 1043, 1.4, 1, 0, "う、疑ってすまなかったな…");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("生けとし生ける全ての者よ！", 0, 0, "わらわこそは夜を総べる者！", 1, 2, 1, 0, "イリヤ・オーンスタイン", 0, 1044, 1.4, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ぐふふふふ……はっ！", 0, 0, "そこで騎士は妖精を乱暴に……", 1, 2, 1, 0, "遠見 空花", 0, 1045, 1.4, 1, 0, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 2, 1, 0, "宮坂たまき", 0, 1046, 1.4, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("それでは早速クエストに…", 0, 0, "大神美冬よ！", 1, 2, 1, 0, "大神 美冬", 0, 1048, 1.4, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("クエストもバトルも\n掃除も洗濯も", 0, 0, "星野静流だよ！", 1, 2, 1, 0, "星野静流", 0, 1049, 1.4, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("見ての通りの\nセクシー美少女で", 0, 0, "アタシは玉泉美咲。", 1, 2, 1, 0, "玉泉美咲", 0, 1050, 1.5, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("？？？？", 0, 0, "？？？", 1, 2, 1, 0, "リマ", 0, 1052, 1.4, 1, 0, "？？？？");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("菓子でつろうなどと\n稚拙な策を……", 0, 0, "モニカ・ヴァイスヴィントだ。", 1, 2, 1, 0, "モニカ・ヴァイスヴィント", 0, 1053, 1.5, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("菓子でつろうなどと\n稚拙な策を……", 0, 0, "モニカ・ヴァイスヴィントだ。", 1, 2, 1, 0, "ペコリーヌ", 0, 1058, 1.5, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("菓子でつろうなどと\n稚拙な策を……", 0, 0, "モニカ・ヴァイスヴィントだ。", 1, 2, 1, 0, "コッコロ", 0, 1059, 1.5, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("菓子でつろうなどと\n稚拙な策を……", 0, 0, "モニカ・ヴァイスヴィントだ。", 1, 2, 1, 0, "キャル", 0, 1060, 1.5, 1, 0, "そ、そこまでいうなら\nもらってやる");
